import React from 'react';
import '../App.css';
import logo from '../logo.svg';
import TestContainer from './TestContainer'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <TestContainer />
      </header>
    </div>
  );
}

export default App;
